import Vue from 'vue'
import Router from 'vue-router'
import IntroPage from '@/views/IntroPage'
import LoginPage from '@/views/LoginPage'
import MainOnePage from '@/views/MainOnePage'

Vue.use(Router)

export default new Router({
    routes: [
        {
            path: '/',
            name: 'IntroPage',
            component: IntroPage
        },
        {
            path: '/login',
            name: 'LoginPage',
            component: LoginPage
        },
        {
            path: '/main_one',
            name: 'MainOnePage',
            component: MainOnePage
        }
    ]
})
